  input: "TEXT,F3XA,,\"Response to questions raised concerning the Committee's Year
    End Report for the period December 11, 2001 through December 31, 2001 (the '2001
    Year End Report'). \tPostage:  The Committee was assessed the usual and customary
    charge for postage by the DCCC at the rate established by the United States Postal
    Service.  The Committee did not receive a discount or pay less than the usual
    and normal charge for postage.  Therefore, it did not receive an in-kind contribution
    from the DCCC. Administrative Expenses:  The Committee does not have an office,
    it uses a post-office box for receiving mail.  The Committee's reports disclose
    payments to an accountant who processes contributions, deposits funds, pays expenses,
    prepares FEC reports, and handles other day-to-day items for the Committee.  The
    Committee hires fundraising consultants to help raise funds.  The Committee also
    makes payments to a law firm to review legal matters that arise from time to time.
    \ In addition, some individuals volunteer their personal time to assist the Committee.
    \ On the 2001 Year End Report, the Committee's reported administrative expenses
    include postage, long distance telephone service, and legal fees.  The Committee
    did not receive any in-kind contributions in the form of goods or services (other
    than volunteer activity) during the 2001 Year End Report period. \""
